    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Lacreek NWR and Lacreek Wetland Management District
    for the next 15 years. This plan outlines the Complex vision and purpose and describes
    how Lacreek NWR and Lacreek Wetland Management District will contribute to the overall
    mission of the Refuge System. The plan provides an introduction to the Refuge and
    the WMD, an overview of the CCP process, a summary of refuge resources, and information
    about the management direction. Key planning issues include: habitat management,
    black-trailed prairie dog management, noxious weed control, water rights, public
    use, recreation, and species of concern.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
